SELECT ?birthPlace WHERE {
  # Find the birth place of Vince Gilligan
  <http://dbpedia.org/resource/Vince_Gilligan> <http://dbpedia.org/ontology/birthPlace> ?vinceGilliganBirthPlace .

  # Find the governor's birth place (which is a region and an administrative region)
  ?governor <http://dbpedia.org/property/state> ?vinceGilliganBirthPlace ;
             <http://dbpedia.org/ontology/birthPlace> ?governorBirthPlace .

  # Find the author of El Deafo
  <http://dbpedia.org/resource/El_Deafo> <http://purl.org/dc/elements/1.1/creator> ?author .

  # Find the birth place of the awardee of List of awards and nominations received by Vince Gilligan
  ?awardee <http://dbpedia.org/property/awards> <http://dbpedia.org/resource/List_of_awards_and_nominations_received_by_Vince_Gilligan> ;
             <http://dbpedia.org/ontology/birthPlace> ?awardeeBirthPlace .
}

SELECT ?result WHERE { 
  ?book <http://dbpedia.org/property/title> "Always the Love Songs"@en ;
         <http://dbpedia.org/ontology/writtenBy> ?writer .
  ?war <http://dbpedia.org/property/name> "Great Turkish War" ;
       <http://dbpedia.org/ontology/commander> ?commander .
  FILTER(?writer = ?commander)
}

SELECT ?politician WHERE {
  ?politician a dbo:Politician ;
               dbo:child ?child .
  ?parent a dbo:Person ;
           dbo:deathPlace "Taipei" ;
           dbo:child ?politician .
}

SELECT ?ceceBellBirthPlace ?governorBirthPlace ?awardeeBirthPlace WHERE {
  # Find Cece Bell's birth place
  ?ceceBell <http://dbpedia.org/ontology/birthPlace> ?ceceBellBirthPlace .

  # Find Paulus Powell's birth place and its regions and administrative regions
  ?powell <http://dbpedia.org/ontology/birthPlace> ?powellBirthPlace ;
           <http://dbpedia.org/property/region> ?region ;
           <http://dbpedia.org/property/administrativeRegion> ?administrativeRegion .

  # Find the governor from those regions who is a politician
  ?governor <http://dbpedia.org/ontology/birthPlace> ?governorBirthPlace ;
             <http://dbpedia.org/ontology/occupation> "Politician"@en ;
             <http://dbpedia.org/property/governanceRegion> ?region .

  # Find the awardee of List of awards and nominations received by Vince Gilligan
  ?awardee <http://dbpedia.org/property/awards> <http://dbpedia.org/resource/List_of_awards_and_nominations_received_by_Vince_Gilligan> ;
             <http://dbpedia.org/ontology/birthPlace> ?awardeeBirthPlace .
}

